import { Route, Routes } from "react-router-dom";
import AllMeetupsPage from "./pages/AllMeetups";

function App() {
  return (
    <Routes>
      <Route path="/" exact>
        <AllMeetupsPage />
      </Route>
    </Routes>
  );
}

export default App;
